INSERT INTO Messages (ID, Boards, Title, Author, Abstract, Body, Icon, Created, Expires, Parent, Priority, StaffCount, WorldCount) VALUES (1,4,'First Post!',127331,'Welcome to the new message board system! Click \"Read More...\" for more information about the recent changes.','As you may have noticed, the colors are different. This is to maintain a level of consistency with other SCU sites and the soon to be unveiled new LINC/Labs web pages.\r\n<BR><BR>\r\nAlong with the updated colors, the login screen has been changed slightly. As is obvious, the only option is to log in, other other stuff has been removed as the staff site will be independant of the new general sites.\r\n<BR><BR>\r\nAlso, there is obviously this message system which is a new addittion. It has been tested, though it may have some quirks - if you notice anything you think to be a problem, please <A HREF=\"mailto:tschundler@scu.edu\">E-Mail me</A>.\r\nThe messages are allowed one level of comments - i.e. messages posted can be replied to, however replies to replies are not supported.\r\nSome other features:\r\n<BR><UL>\r\n<LI><B>Icons -</B> Messages can have images associated with them, intented to provide the user with a visual cue as the to intent of the message - i.e. for a message regarding a pending schedule change, the calendar would be appropriate.</LI>\r\n<LI><B>Priority -</B> Messages are sorted by their priority, then by date. Generally messages should be posted as \"Normal\" priority. \"High\" Priority should only be used for messages which will expire or otherwise be removed within a few days of being posted, as they well be listed before all other messages. If you would like to keep a message in the database rather than deleting it or giving it an expiration, it should be moved to \"Low\" priority.</LI>\r\n<LI><B>Expiration -</B> The default expiration date is one week from the date a message is posted. Messages are automatically deleted once their expiration has passed. This keeps the board generally less cluttered. For messages regarding schedule adjustments, the expiration should be a day after the message applies to. (i.e. if you will not be in friday, set the expiration to sometime saturday)</LI>\r\n<LI><B>Abstract vs Body -</B> The Abstract is the what is displated in the message list as is limited to 255 characters. More detailed information can be put in the Body which has a limit of 65535 characters and is displayed when the user click \"Read More...\" - the size of the message Body is shown in the message list if there is a Body.</LI>\r\n<LI><B>Where to Post -</B> There are currently 4 places users can post (depending upon what type of users they are): The Knowledge Base (RCC/Helpdesk), Staff General (RCC/Helpdesk/Lab TAs), Support Staff (RCC/Helpdesk), and Lab TAs (Lab TAs). Messages that both TAs and RCC/Helpdesk people should see should be posted in Staff General. Messages that are only for RCC/Helpdesk staff should be posted in \"Support Staff\". Messages applicable to Lab TAs only should be posted in \"Lab TAs\". Finally there is the \"Knowledge Base\", which is intened as a place to post solutions to problems. At some point, the KB will be searchable.</LI>\r\n<LI><B>Post Comment -</B> Top level messages can be replied to using the \"Post Comment\" feature. Comments will be listed in a table below the message body when a user clicks \"Read More...\". Additionally the number of comments are displayed in the message list (if there are any).</LI>\r\n</UL>\r\n<BR><BR>\r\nFinally, for RCCs/Helpdesk, the ticket status page has changes slightly (the window that pops up to view a ticket\'s history / add to the ticket). The changes are primarily cosmetic, but there is the chance that something could have been inadvertently damanged. So, if you any bugs are discovered that hinder the operation of the system, <I>call me immediately at x3060</I>. For non critical issues, just E-Mail me. Also, tickets are now marked as \"CLOSED\" rather than \"COMPLETED\", since COMPLETED is an inaccurate label for a ticket for which we could not get in contact with the client for instance.',2,20010315233609,NULL,1,3,14,0);
INSERT INTO Messages (ID, Boards, Title, Author, Abstract, Body, Icon, Created, Expires, Parent, Priority, StaffCount, WorldCount) VALUES (2,28,'E-Mail Addresses',127331,'<H3>Important:</H3>You should have received an E-Mail entitled \"Changes in database system\", sent the 15th<BR>If you did <B>NOT</B> receive the message then your E-Mail address is not in the database - you must add it using the \"Account/Schedule\" feature.','',0,20010316002523,'2001-03-24 00:00:00',2,2,4,0);
INSERT INTO Messages (ID, Boards, Title, Author, Abstract, Body, Icon, Created, Expires, Parent, Priority, StaffCount, WorldCount) VALUES (3,4,'Drive size',59484,'Alex, been hearing your actually more like 250 megs.  So sad.','',1,20010316002644,'2001-03-22 23:38:00',3,1,2,0);
