INSERT INTO PaperTrail (ThisID, Creator_CampusID, Receiver_CampusID, State, Comment, Department, TicketID, Creation, IsFirst, IsLast, Appointment) VALUES (760,127331,0,'OPEN','Personally, I don\'t think that\'s the best idea - first remove all driver for the card, remove the card, maybe try the card in another laptop if possable. Reinstall card again, verifying drivers are correct, possably using a nearby computer to download the correct drivers to a floppy. If it automatically installs card w/o asking for drivers, goto device manager and use the update drivers option, to install the drivers from the disk. Also, if it shows up in device manager, try checking to see if the TCP/IP drivers are installed & set to DHCP. if they are see if winipcfg can get a lease. etc, etc, etc.\r\n\r\nThen if all else fails you might want to give installing the OS a chance, though use the recovery CD if possable, not the Win98 CD (recovery CD may ask for the \'98 CD...though I\'d really consider that only a last resort\r\n\r\nAlso, make sure you get info about the brand & model of the network card to enter into the database.\r\n\r\nTed','LINC',423,'2001-02-08 16:10:27','N','N',NULL);
