INSERT INTO PaperTrail (ThisID, Creator_CampusID, Receiver_CampusID, State, Comment, Department, TicketID, Creation, IsFirst, IsLast, Appointment) VALUES (769,127331,127331,'ACTIVE','Andry\'s assesment:\r\n\r\nHi Ted,\r\n\r\nI just spent two hours trying to fix her computer, and I solved nothing. \r\nOkay, here\'s the story. \r\nShe had been unable to shut down Windows properly, and scandisk always shows up at startup. She suspected that her second hard drive was damaged, because scandisk always says that there\'s some bad sectors in the disk.\r\nAnd just last night, she installed WinME over the Win98, \'cause she thought it\'d solve the problem! And now scan disk makes the computer crash before anything else comes out. When we got lucky to pass the scandisk, opening My Computer would also freeze the computer. \r\nSo I went to DOS, and tried to access the D drive, which I thought might be causing all that. In DOS, I can go to D prompt, but typing \'dir\' would give an error message (abort, fail, etc.).\r\nSo I thought the D drive was damaged, and maybe disabling it would solve some problems.\r\nBecause I wasn\'t sure how to disable it thru the BIOS, I unplugged one of the drives (the slave one). After restarting the PC, the BIOS wouldn\'t detect the drive. I tried to plug the other drive, and it still wouldn\'t detect it. The only time it would detect the drives was when I put both of them back together. Even then, there\'s an error message \"Invalid System Disk\" at booting up, and computer wouldn\'t load windows anymore.\r\n\r\nI tried everything I could think of, but I couldn\'t get it to work. Booting from CD didn\'t work. I didnt\'t try booting from floppy \'cause I didn\'t have a boot disk (I don\'t even know if WinME has a boot disk). \r\nAnyway, since I don\'t really know much about hardware, it could be just a simple problem.\r\n\r\nMy guess is that the D drive is damaged, and the OS in the C drive is totally messed up.','LINC',421,'2001-02-08 21:50:39','N','N',NULL);
