INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (1,'queries.php?QID=1','SELECT q.QueryID AS \'Query ID\', q.QHyperLink AS \'QHyperlink\', q.Description AS \'Description\'  FROM Queries AS q, People AS p WHERE p.CampusID=q.Creator_CampusID AND Hide=\'N\'','Show list of queries',127331,'N','N','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (2,'queries.php?QID=2','SELECT concat(p.Last,\', \',p.First,\' \',p.Middle) AS Employee, (COUNT(*)/2) AS \'Hours Available\',(SUM(s.Position!=\'UNASSIGNED\')/2) AS \'Scheduled Hours\'  FROM People AS p, Schedule as s WHERE p.CampusID=s.CampusID GROUP BY s.CampusID ORDER BY Employee','Hours Available and Hours Worked',127331,'N','N','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (3,'queries.php?QID=3','include \"result-ticket.php\";','Requested Tickets',127331,'Y','Y','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (4,'queries.php?QID=4','SELECT s.SessionID AS \'SID\',p.CampusID AS \'CampusID\', IF(LENGTH(p.Nick)>0,concat(p.Nick,\' \',p.Last), concat(p.First,\' \',p.Last)) AS \'User\', u.UserName, concat(\'0x\',RIGHT(HEX(s.RemoteIP),8)) AS \'RemoteIP\', SEC_TO_TIME(UNIX_TIMESTAMP()-UNIX_TIMESTAMP(s.timestamp)) AS \'Idle\' FROM People AS p, Users as u, Sessions as s WHERE u.CampusID=s.CampusID AND p.CampusID=s.CampusID','Users Currently Logged In',127331,'N','N','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (5,'queries.php?QID=5','SELECT Date, SUM(PC), SUM(MAC), SUM(UNIX), (SUM(PC)+SUM(MAC)+SUM(UNIX))/COUNT(*) AS Avg, COUNT(*) AS \'Counts\' FROM LabCounts GROUP BY Date ORDER BY Avg DESC','Total Lab Counts',127331,'N','N','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (8,'queries.php?QID=8','$query_string=\"SELECT ID, Title, \".sql_daytime(\"Created\").\" AS Created, \'Edit\' AS Edit, concat(\'listnews.php?ID=\',ID,\'&Action=Edit\') AS EditHyperlink, \'View\' AS View, concat(\'listnews.php?ID=\',ID,\'&Action=Read\') AS ViewHyperlink, \'Delete\' AS \'Delete\', concat(\'listnews.php?ID=\',ID,\'&Action=Delete\') AS DeleteHyperlink FROM Messages WHERE Author=\".$CampusID;','My Past Posts',127331,'Y','Y','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (6,'queries.php?QID=6','$query_string=\"select pt1.TicketID, concat(\'ticketstatus.php?TID=\',pt1.TicketID) AS \'TIDPopup\', pt1.Comment AS \'Description\', pt3.State, pt3.Creation AS \'Last Change\' FROM PaperTrail as pt1, PaperTrail as pt2, PaperTrail as pt3 WHERE pt2.Creator_CampusID=$CampusID AND pt1.TicketID=pt2.TicketID AND pt3.TicketID=pt1.TicketID AND pt1.IsFirst=\'Y\' AND pt3.IsLast=\'Y\' GROUP BY pt1.TicketID ORDER BY \'Last Change\' DESC\";','My Old Tickets',127331,'Y','Y','N');
INSERT INTO Queries (QueryID, QHyperLink, Query, Description, Creator_CampusID, IsPHPCode, NonAdminSafe, Hide) VALUES (7,'queries.php?QID=7','SELECT Trying AS \'Login Name\', concat(\'0x\',RIGHT(HEX(IP),8)) as \'IP\', COUNT(*) As \'Count\', DATE_FORMAT(MIN(When),\'%b %e, %Y  %r\') As \'First Time\', DATE_FORMAT(MAX(When),\'%b %e, %Y  %r\') AS \'Latest\', SEC_TO_TIME(UNIX_TIMESTAMP(MAX(When)) - UNIX_TIMESTAMP(MIN(When))) AS \'ATBF\' FROM LoginFailures GROUP BY IP, Trying ORDER BY \'Count\' DESC, \'IP\'','Login Failures',127331,'N','N','N');
